window.bookSummaryJSON = "<p>An elven assassin. A dragon prince. Three days they had together. Three days was not enough. </p> <p>There's a traitor among the elves. A traitor who will stop at nothing to see Eroan pay for the crime of loving a dragon, and Eroan Ilanea will pay with blood. </p> <p>Lysander has never been free to choose his fate. That is about to change. Finally, he learns what it means to be emerald, but knowledge is power, and power whispers its seductive curse into the ear of a broken prince. </p> <p>Elf and dragon. Leaders, lovers, fighters. Fates entwined. </p> <p>But as the dragonkin rise under a new king, will Eroan's and Lysander's boundless love save the world or destroy it forever? </p> <p>Contains mature themes.</p>"; 
